  return (
    <>
      <div className="nav-seciton">
        <div className="nav-wrapper">
          <div className="logo-section">
            <h4 className="text"> OnlineStore</h4>
          </div>

          <div className="list-wrapper">
            <a className="nav-link" href="/">
