                <HomeIcon />
                <p className="nav-content">Home</p>
              </div>
            </a>

            <div className="nav-text">
              <SearchIcon />
              <p className="nav-content">Search</p>
            </div>

            <div
              className="nav-text dropdown-btn"
              onClick={() => {
                setShow(!show);
